// src/Navbar.js
import React from 'react';

function Navbar() {
    return (
        <nav style={styles.navbar}>
            <h1 style={styles.navTitle}>PDF Uploader</h1>
        </nav>
    );
}

const styles = {
    navbar: {
        backgroundColor: '#333',
        padding: '1rem',
        color: 'white',
        textAlign: 'center',
    },
    navTitle: {
        margin: '0',
    }
};

export default Navbar;
